const Mobile = {
  mobile: {
    backgroundImage: "mobile.svg",
    machineDisplay: "none",
    newsletterWidth: "100%",
  },
  desktop: {
    backgroundImage: "dark-bg.svg",
    machineDisplay: "block",
    newsletterWidth: "50%",
  },
};

export default Mobile;
